import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faBars } from '@fortawesome/free-solid-svg-icons';
import {Modal, Box} from '@mui/material'; 
import React, {useState} from 'react';
import './Art.css';

const Art = () => {
    const artImages = [{
        photo: "/1.jpg",
        text:"first project"
    },
    {
        photo: "/2.jpg",
        text:"second project"
    },
    {
        photo: "/25.jpg",
        text: "third project"
    },
    {
        photo: "/3.jpg",
        text: "third project"
    },
    {
        photo: "/6.jpg",
        text: "third project"
    },
    {
        photo: "/5.jpg",
        text: "third project"
    },
    {
        photo: "/4.jpg",
        text: "third project"
    },
    {
        photo: "/7.jpg",
        text: "third project"
    },
    {
        photo: "/8.jpg",
        text: "third project"
    },
    {
        photo: "/9.jpg",
        text: "third project"
    },
    {
        photo: "/10.jpg",
        text: "third project"
    },
    {
        photo: "/27.jpg",
        text: "third project"
    },
    {
        photo: "/11.jpg",
        text: "third project"
    },
    {
        photo: "/28.jpg",
        text: "third project"
    },
    {
        photo: "/12.jpg",
        text: "third project"
    },
    {
        photo: "/13.jpg",
        text: "third project"
    },
    {
        photo: "/14.jpg",
        text: "third project"
    },
    {
        photo: "/15.jpg",
        text: "third project"
    },
    {
        photo: "/16.jpg",
        text: "third project"
    },
    {
        photo: "/17.jpg",
        text: "third project"
    },
    {
        photo: "/18.jpg",
        text: "third project"
    },
    {
        photo: "/19.jpg",
        text: "third project"
    },
    {
        photo: "/20.jpg",
        text: "third project"
    },
    {
        photo: "/26.jpg",
        text: "third project"
    },
    {
        photo: "/21.jpg",
        text: "third project"
    },
    {
        photo: "/22.jpg",
        text: "third project"
    },
    {
        photo: "/23.jpg",
        text: "third project"
    },
    {
        photo: "/24.jpg",
        text: "third project"
    }
    ]
    const [openModal, setOpenModal] = useState();
    const [imgsrc, setImagesrc] = useState();
    const [imgdescp, setImgdescp] = useState();

    const showSrc = () => {
        console.log(imgsrc);
    }

    const style = {
        position: 'absolute',
        top: '50%',
        left: '50%',
        transform: 'translate(-50%, -50%)',
        width: '30%',
        height: '40vw',
        bgcolor: 'rgba(0, 0, 0, .5)',
        color: 'white',
        p: 4,
      };
    return (
        <div className="art">
             <div className="top-bar">
                <div className="logo"><a href='/about'><img src="/logo.png" alt='logo'/></a></div>
                <div className="grid-container">
                    <div className="grid-child"><button type="button"><a href="/about">about</a></button></div>
                    <div className="grid-child"><button type="button"><a href="/projects">projects</a></button></div>
                    <div className="grid-child"><button type="button" id="active"><a href="/art">art</a></button></div>
                    <div className="grid-child"><button type="button"><a href="/resume">resume</a></button></div>
                </div>
                <div className="dropdown">
                    <button>
                        <FontAwesomeIcon icon={faBars} className="dropbtn"/>
                    </button>
                    <div className="dropdown-content">
                        <a href="/about">about</a>
                        <a href="/projects">projects</a>
                        <a href="/art">art</a>
                        <a href="/resume">resume</a>
                    </div>
                </div>
            </div>
            <div className="bodyArt">
                <h2>some of my hobbies</h2>
                <div className="gridArt">
                    {artImages.map((e,i) => 
                        <div className="outerChild" onClick={() => {setOpenModal(true); setImagesrc(e.photo); setImgdescp(e.text); showSrc()}} >
                            <div className="gridArt-child" style={{ 
                                backgroundImage: `url(${e.photo})` 
                            }}></div>

                        </div>
                    )}
                    <Modal
                        open={openModal === true}
                        onClose={() => setOpenModal(false)}
                        disableAutoFocus={true}
                        aria-labelledby="modal-modal-title"
                        aria-describedby="modal-modal-description"
                    >
                        {/* <Box sx={style}> */}
                        <img id="modalImage" src={imgsrc} alt={imgdescp}></img>
                        {/* </Box> */}
                    </Modal>


                </div>
            </div>
        </div>   
    )
};

export default Art;
